import { View, Text, TouchableOpacity } from 'react-native'
import React from 'react'
import { SafeAreaView } from 'react-native-safe-area-context'
import reusable from '../../components/Reusable/reusable.styles'
import { AddTeam, HeightSpacer, ReusableText } from '../../components'
import { COLORS, SIZES, TEXT } from '../../constants/theme'
import {AntDesign} from '@expo/vector-icons'
import styles from './home.styles'
import Queue from '../../components/Home/Queue'
import Queue1 from '../../components/Home/Queue1'

const Home = ({ navigation, route }) => {
  const { id, latitude, longitude, title } = route.params || {};
  return (
    <SafeAreaView style={reusable.container}>
      <View>
        <View style={reusable.rowWithSpace('space-between')}>
          <ReusableText 
            text={'Hey User!'}
            family = {"regular"}
            size={TEXT.large}
            color={COLORS.black}
          />
          <TouchableOpacity style={styles.box} 
          onPress={()=>navigation.navigate('Search')}>
            <AntDesign 
            name='search1'
            size={26}
            />
          </TouchableOpacity>
        </View>
        <ReusableText 
          text={title}
          family = {"medium"}
          size={TEXT.large}
          color={COLORS.black}
        />
      </View>
      <Queue1 />
      <AddTeam />
    </SafeAreaView>
  )
}

export default Home
